import React from "react";
import { Link } from "react-router-dom";

// navbar component
import Navigation from "../../components/Navigation/Navigation";

const About = () => (
    <div>
        <Navigation/>
        <article class="message">
            <div class="message-header">
                <p>About the site</p>
                <button class="delete" aria-label="delete"></button>
            </div>
            <div class="message-body">
                Hello, and welcome to <strong>(ME)seum</strong>! We're so glad you decided to check out our site. (ME)seum is a digital art browser, where you can search and learn about a wide variety of works of art from all around the world. Just visit the <Link className="nav-link" to={"/explore"}><strong>explore</strong></Link> page to begin your search. 

                On the explore page, just favorite a work of art to add it to your own personal <Link className="nav-link" to={"/gallery"}><strong>gallery</strong></Link>!
            </div>
        </article>
    </div>
);

export default About
